import React, { useState } from 'react';
import Card from '@material-ui/core/Card';
import CardHeader from '@material-ui/core/CardHeader';
import CardMedia from '@material-ui/core/CardMedia';
import CardContent from '@material-ui/core/CardContent';
import CardActions from '@material-ui/core/CardActions';
import Button from '@material-ui/core/Button';
import Avatar from '@material-ui/core/Avatar';
import Typography from '@material-ui/core/Typography';
import Collapse from '@material-ui/core/Collapse';
import IconButton from '@material-ui/core/IconButton';
import ExpandMoreIcon from '@material-ui/icons/ExpandMore';
import ExpandLessIcon from '@material-ui/icons/ExpandLess';
import HeartIcon from '@material-ui/icons/Favorite';
import ShareIcon from '@material-ui/icons/Share';
import MoreIcon from '@material-ui/icons/MoreVert';
import List from '@material-ui/core/List';
import ListItem from '@material-ui/core/ListItem';
import ListItemAvatar from '@material-ui/core/ListItemAvatar';
import ListItemText from '@material-ui/core/ListItemText';
import Divider from '@material-ui/core/Divider';
import { makeStyles } from '@material-ui/core/styles';
import Meghan from '../site-images/meghan.jpg';
import Abbey from '../site-images/abbey.jpg';
import Simeon from '../site-images/simeon.jpg';
import Jessica from '../site-images/jessica.jpg';

const useStyles = makeStyles((theme) => ({
    card: {
        maxWidth: 450,
        margin: 'auto',
        padding: theme.spacing(2),
    },
    media: {
        height: 0,
        padding: '56.25%',
    },
}));

export default function CardExample() {
    const classes = useStyles();

    return (
        <Card 
            className={classes.card} 
        >
            <CardMedia 
                image={Jessica} 
                alt='Simeon Ikudabo'
                title='Simeon Ikudabo' 
                className={classes.media} 
            />
            <CardContent>
                <Typography 
                    variant='overline'
                    component='span' 
                >
                    Simeon Ikudabo
                </Typography>
                <Typography 
                    variant='body1' 
                    component='p' 
                >
                    Simeon Ikudabo is the founder of Excite.socal, a social media platform that 
                    connections millions of people all over the world. Simeon Ikudabo has created 
                    a platform that helps people connect in a non-toxic manner and continously 
                    improve their lives via building real connections on the platform. 
                </Typography>
            </CardContent>
            <CardActions>
                <Button>
                    Learn More 
                </Button>
                <Button>
                    Discover 
                </Button>
            </CardActions>
        </Card>
    );
}
